import React from "react";

import Header from "./Header";
import Footer from "./Footer";

function Users() {
<>
<Header/>
<form onSubmit={sendEmail} name="FormContato" className="FormContato" action="/users">
  <div className="field">
    <label htmlFor="name">Nome</label>
    <input className="CampoFormContato" type="text" name="name" id="name" required/>
  </div>

  <div className="field">
    <label htmlFor="surname">Sobrenome</label>
    <input className="CampoFormContato" type="text" name="surmane" id="email" required/>
  </div>
</form>
<Footer/>
</>
}

export default Users;
